import React from 'react';

class InfoUser extends React.Component {
  render()
    {
      return (
        <div>
          <div>{this.props.id}</div>
          <div>{this.props.firstName}</div>
          <div>{this.props.lastName}</div>
          <div>{this.props.bdate}</div>
        </div>
      )
    }
}

export default InfoUser
